import React from 'react';
import { AppBar, Toolbar, Typography, Box } from '@mui/material';
import { Link as RouterLink } from 'react-router-dom';

const Header = () => {
  return (
    <AppBar position="static" sx={{ bgcolor: '#fff' }}>
      <Toolbar sx={{ justifyContent: 'space-between' }}>
        <Box sx={{ display: 'flex', alignItems: 'center' }}>
          <img src="/ruta/de/tu/foto/de/perfil.jpg" alt="Mi foto de perfil" width="40" height="40" sx={{ borderRadius: '50%', marginRight: 1 }} />
          <Typography variant="h6" component="div" sx={{ color: '#000' }}>
            Ramiro Slullitel
          </Typography>
        </Box>
        <div sx={{ display: 'flex', gap: 2 }}>
          <Typography variant="subtitle1" component={RouterLink} to="/proyectos" sx={{ color: '#000', textDecoration: 'none' }}>
            Proyectos
          </Typography>
          <Typography variant="subtitle1" component={RouterLink} to="/contacto" sx={{ color: '#000', textDecoration: 'none' }}>
            Contacto
          </Typography>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Header;
